import React from "react";
import './App.css';

import Mainjs from './compoAdd/Mainjs';

function App() {

  /* fetch data*/
  const [items, setItems] = useState([]);

  useEffect(() => {
    const fetchItems = async () => {
      const response = await fetch('https://jsonplaceholder.typicode.com/users');
      const itemsData = await response.json();
      setItems(itemsData);
    };
    fetchItems();
  }, []);

    const useItems = items.map(item =>{
    return <div>
                <ul>
                    <li>Name: {item.name}</li>
                    <li>Username: {item.username}</li>
                    <li>Email: {item.email}</li>
                    <li>Phone: {item.phone}</li>
                    <li>Company: {item.company.name}</li>
                    <li>Website: {item.website}</li>
                    <li>Address:<br/>
                        Street: {item.address.street}<br/>
                        Suite: {item.address.suite}<br/>
                        City: {item.address.city}<br/>
                        Zipcode: {item.address.zipcode}
                    </li>
                </ul>
            </div> 
    })

  return (
    <>

      <div className="container">
          {useItems}
      </div>
    </>
  );
  /* fetch data end */

  return (
    <div className="App">hi
    </div>
  );
}

export default App;
